import React, { Component } from 'react';
import 'p5';
import p5 from 'p5';



let sketch = function(p){
    p.x = 100;
    p.y = 100;
    p.setup = function() {
        p.createCanvas(200,200);
        p.background(51);
    }
    p.draw = function(){
        p.fill(255,0,200,25);
        p.ellipse(10,100,48,48)
    }

}
let myp5 = new p5(sketch)
class Hello extends Component{
    render() {
        return
        myp5()
    }
        
            
        
    
}

export default Hello;
